import React, { Component } from "react";
import PropTypes from "prop-types";
//import Show from "./layout/Show";

class Img extends Component {
  render() {
    //let url = "";
    //const images = ;

    //Object.entries(images).forEach(([key, val]) => {
    this.props.images.map((val) => {
      //url = this.props.getImageUrl(val.farm, val.server, val.id, val.secret);
      console.log(
        this.props.getImageUrl(val.farm, val.server, val.id, val.secret)
      );
      return (
        <li>
          <img
            src={this.props.getImageUrl(
              val.farm,
              val.server,
              val.id,
              val.secret
            )}
            alt="flickr-img"
          />
        </li>
      );
    });

    return (
      <div>
        <img
          src={this.props.getImageUrl(val.farm, val.server, val.id, val.secret)}
          alt="flickr-img"
        />
      </div>
    );
  }
}
//PropTypes
Img.propTypes = {
  getImageUrl: PropTypes.func.isRequired,
  images: PropTypes.array,
};
//<img src={url} alt="flickr-img" />
export default Img;
